import logo from '../logo.svg';
import './Site.css';
import '../global.css';
import NavBar from './NavBar.js';
import Hero from './Hero.js';
import PortfolioGrid from './PortfolioGrid.js';

function Site() {
  return (
    <div>
      <div class="Container">
        <NavBar />
        <Hero />
      </div>
      <div>
        <PortfolioGrid />
      </div>
    </div>
  );
}

export default Site;
